import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Card from "./component/Card";

class MyComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch(
      "https://v2-api.sheety.co/69072a59b5982e9dd27aaa5bf290e8c6/dazad/api1"
    )
      .then(res => res.json())
      .then(
        result => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Remarque : il est important de traiter les erreurs ici
        // au lieu d'utiliser un bloc catch(), pour ne pas passer à la trappe
        // des exceptions provenant de réels bugs du composant.
        error => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      );
  }
}

console.log(componentDidMount);

function App() {
  return <Card />;
}

export default App;
